import React from 'react';
import Header from '../components/Header';

const AboutPage = () => {
  return (
    <div>
      <Header />
      <section style={{ padding: '4rem 2rem', minHeight: '60vh' }}>
        <div style={{ maxWidth: '800px', margin: '0 auto' }}>
          <h1 style={{ fontSize: '3rem', marginBottom: '2rem', textAlign: 'center' }}>About Us</h1>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '2rem' }}>
            <div>
              <h3>Our Mission</h3>
              <p>We provide high-quality wallpapers and images for everyone.</p>
            </div>
            <div>
              <h3>Our Vision</h3>
              <p>To become the leading platform for creative wallpapers.</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};
